package com.spring.entity;

public class Scores {
	private int scid, sc_sid, sc_cid, sc_pid;

	public Scores() {
		super();
		// TODO Auto-generated constructor stub
	}
	

	public int getScid() {
		return scid;
	}

	public void setScid(int scid) {
		this.scid = scid;
	}

	public int getSc_sid() {
		return sc_sid;
	}

	public void setSc_sid(int sc_sid) {
		this.sc_sid = sc_sid;
	}

	public int getSc_cid() {
		return sc_cid;
	}

	public void setSc_cid(int sc_cid) {
		this.sc_cid = sc_cid;
	}

	public int getSc_pid() {
		return sc_pid;
	}

	public void setSc_pid(int sc_pid) {
		this.sc_pid = sc_pid;
	}
	
}
